import React, { Component } from 'react'

class FirstCompnent extends Component {
    // state = {  } 
    render() { 
        return (
            <div className='container'>
                <header>
                    <div>Calculus</div>
                </header>
                <main className='container'>
                    <div className='row'>
                    <div className='col'>
                        <div className='container'>
                            <div className='row'><button className='btn col'>1</button> <button className='btn col'>2</button> <button className='btn col'>3</button></div>

                        </div>
                        <div>
                        <button>4</button> <button>5</button> <button>6</button>
                        </div>
                        <div>
                        <button>7</button> <button>8</button> <button>9</button>
                        </div>
                        <div><button>0</button> <button> = </button></div>
                    </div>
                    <div>
                    <button>+</button> <button>-</button> <button>x</button> <button>%</button>
                    </div>
                    </div>
                </main>
            </div>
        );
    }
}

export default FirstCompnent;
